  FILTER ( ?from <= '2023-10-04' ^^ xsd:date && ( ! bound( ?to ) || ?to >= '2023-10-04' ^^ xsd:date ) )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?country WHERE {
  fb:m.047sxrj fb:people.person.place_of_birth ?placeOfBirth .
  ?placeOfBirth fb:location.location.country ?country .
}
